$(function() {
    $('.article--vacancy .response-btn').click(function(e) {
        e.preventDefault();

        var responseWrapper = $('.article__vacancy-response-wrapper');
        $('.response-btn').hide();

        $('html, body').animate({
            scrollTop: responseWrapper.offset().top,
        }, 300, function() {
            responseWrapper.css('visibility', 'visible');
            responseWrapper.find('textarea').focus();
        });
    });

    var vacancyMap = $('#vacancy-map');
    if (vacancyMap.length && typeof ymaps != 'undefined') {
        ymaps.ready(init);
        function init(){
            var myGeocoder = ymaps.geocode(vacancyMap.attr('data-address'));
            myGeocoder.then(
                function (res) {
                    var coords = res.geoObjects.get(0).geometry.getCoordinates();
                    var myMap = new ymaps.Map(vacancyMap[0], {
                        center: coords,
                        zoom: 15
                    });

                    myMap.geoObjects.add(new ymaps.Placemark(coords, {
                        balloonContent: 'Мы находимся тут'
                    }));
                }
            );
        }
    }

    // Кнопки операций с откликами
    $('.article__vacancy-response-action-btn').click(function(e) {
        e.preventDefault();

        var btn = $(this);
        var response = btn.closest('.article__vacancy-response');
        var action = btn.attr('data-action');

        if (action == 'delete' && !confirm('Вы уверены?')) {
            return false;
        }

        btn.css('opacity', 0.6);

        $.post(btn.attr('href'), {}, function(res) {
            btn.css('opacity', 1);

            if (res.success) {
                var text = $('<span>', {class: 'article__vacancy-response-action-text'}).text('qwe');

                switch (action) {
                    case 'approve':
                        response.find('.article__vacancy-response-action-btn[data-action="reject"]').remove();
                        text.text('Приглашен ' + res.date);
                        break;
                    case 'reject':
                        response.find('.article__vacancy-response-action-btn[data-action="approve"]').remove();
                        text.text('Отказ ' + res.date);
                        break;
                    case 'delete':
                        text.text('Удалён');
                        setTimeout(function() {
                            response.fadeOut(300, function() {
                                $(this).remove();
                            });
                        }, 1000);
                        break;
                }

                text.insertAfter(btn);
                btn.remove();
            }
        });
    });
});

$(function() {
    var $root = $('.cabinet-org');
    if ($root.length) {
        // Кнопка добавления|редактирования сотрудника организации
        $root.find('.edit-employee').click(function() {
            var btn = $(this);
            var oper = btn.attr('data-oper');
            var popup = $('#editEmployee');
            var title = popup.find('.popup__title');
            var searchTitle = popup.find('.popup__search-title');
            var searchWrapper = popup.find('.search-new');
            var searchInput = popup.find('.search-new__input');
            var searchBtn = popup.find('.search-new__btn');
            var searchResults = popup.find('.search__results');
            var employeeProto = popup.find('.popup__employee-wrapper--proto');
            var popupForm = popup.find('.popup__form');
            var formErrors = popupForm.find('.popup__errors');

            searchResults.find('.popup__employee-wrapper:not(.popup__employee-wrapper--proto)').remove(); // удаление старых результатов поиска
            popupForm[0].reset();
            title.text(title.attr('data-text-' + oper));
            searchTitle.hide();

            if (oper == 'add') {
                searchWrapper.show();
            } else {
                searchWrapper.hide();
            }

            searchBtn.click(function() {
                $.ajax({
                    type: 'POST',
                    url: '/ajax/ajax-cabinet-org/get-users',
                    data: {
                        term: searchInput.val(),
                        company_id: popup.attr('data-company-id'),
                        exclude_employed: true
                    },
                    dataType: 'json',
                    success: function (res) {
                        searchResults.find('.popup__employee-wrapper:not(.popup__employee-wrapper--proto)').remove();
                        searchTitle.show();

                        if (res.users.length > 0) {
                            res.users.forEach(function(v) {
                                var newEmployee = employeeProto.clone().removeClass('popup__employee-wrapper--proto').appendTo(searchResults);
                                initEmployee(newEmployee, v);
                            });
                        } else {
                            searchResults.append($('<div>', {class: 'col-sm-6 popup__employee-wrapper', text: 'Не найдено ни одного пользователя'}));
                        }
                    }
                });
            });

            function initEmployee(employee, data) {
                employee.find('.popup__employee-name').text(data.fullname);
                employee.find('.popup__employee-degree').text(data.degree);
                employee.find('.popup__employee-picture').css({'background-image': 'url(' + data.photoPath + ')'});
                employee.find('.id-input').val(data.id);

                employee.find('.popup__employee-choose-btn').click(function() {
                    searchResults.find('.popup__employee').addClass('popup__employee--inactive');
                    searchResults.find('.popup__employee-choose-btn').removeClass('btn-primary').addClass('btn-outline-primary').text('Выбрать');
                    employee.find('.popup__employee').removeClass('popup__employee--inactive');
                    employee.find('.popup__employee .id-input').prop('checked', true);
                    $(this).removeClass('btn-outline-primary').addClass('btn-primary').text('Выбран');
                });

                if (data.position != undefined) {
                    popupForm.find('.position-input').val(data.position);
                }

                if (data.date_start != undefined) {
                    popupForm.find('.date-start-input').val(data.date_start);
                }

                if (data.date_start_alt != undefined) {
                    popupForm.find('.date-start-input-alt').val(data.date_start_alt);
                }

                if (data.date_end != undefined) {
                    popupForm.find('.date-end-input').val(data.date_end);
                }

                if (data.date_end_alt != undefined) {
                    popupForm.find('.date-end-input-alt').val(data.date_end_alt);
                }

                if (data.staff != undefined) {
                    popupForm.find('#save_staff').prop('checked', data.staff);
                }
            }

            // Заполнение формы данными пользователя
            if (oper == 'edit') {
                var employeeData = JSON.parse(btn.closest('.employment').attr('data-form-data'));
                var newEmployee = employeeProto.clone().removeClass('popup__employee-wrapper--proto').appendTo(searchResults);
                initEmployee(newEmployee, employeeData);
                newEmployee.find('.popup__employee-choose-btn').click();
                popupForm.find('.submit-btn').text('Сохранить изменения');
            }

            // Поиск вместо отправки формы
            searchInput.keypress(function(e) {
                if (e.keyCode == 13) {
                    searchBtn.click();
                    return false;
                }
            });

            popupForm.submit(function() {
                formErrors.html('');

                $.ajax({
                    type: $(this).attr('method'),
                    url: $(this).attr('action'),
                    data: $(this).serialize(),
                    dataType: 'json',
                    success: function (res) {
                        if (!res.success) {
                            for (key in res.errors) {
                                res.errors[key].forEach(function(v) {
                                    formErrors.append($('<li>', {text: v}));
                                });
                            }
                        }
                    }
                });

                return false;
            });

            // Обнуление даты увольнения
            popupForm.find('.input--calendar-single-date-alt').keyup(function() {
                $(this).datepicker('setDate', null);
            });
        });
    }
});

