$(function() {
    var form = $('#eventParticipantsFilterForm');
    if (form.length) {
        form.find('select').change(function() {
            $(this).closest('form').submit();
        });
    }

    var $handleParticipationBtn = $('.participant-table .handle-participation-btn');
    $handleParticipationBtn.click(function() {
        var btn = $(this);
        var participation = btn.closest('.participation');
        var oper = btn.attr('data-oper');

        if (confirm('Вы уверены, что хотите ' + (oper == 'approve' ? 'подвердить' : 'отклонить') + ' заявку'))
            $.post('/ajax/ajax-event-settings/handle-participation', {id: participation.attr('data-id'), oper: oper}, function(res) {
                if (res.success) {
                    participation.fadeOut(300, function() {
                        $(this).remove();
                    });
                }
            }, 'json');
    });

    // Настройка формы регистрации
    var regForm = $('#eventSettingsRegistrationForm');
    regForm.find('.question-add').click(function(e) {
        e.preventDefault();

        var template = regForm.find('.field-template');
        template.find('.save-question-checkbox').prop('disabled', false);
        template.find('.field-variant-selector')
            .prop('disabled', false)
            .change(function () {
                changeFieldVariant(template);
            });
        template.find('.select-option-add').click(function (e) {
            e.preventDefault();

            var variantsWrapper = $(this).siblings('.select-options');
            var newOption = variantsWrapper.find('.select-option:last').clone();
            variantsWrapper.data().index++;
            newOption.find('input[type="text"]').val('');
            newOption.find('.index').text(variantsWrapper.data('index'));
            variantsWrapper.append(newOption)
        });

        changeFieldVariant(template);

        template.show();
        $(this).hide();
    });

    function changeFieldVariant(template) {
        template.find('.field-variant').addClass('field-variant-hidden');
        template.find('.field-variant :input').prop('disabled', true);

        var selectedVariant = template.find('.field-variant[data-type="' + template.find('.field-variant-selector').val() + '"]');
        selectedVariant.find(':input').prop('disabled', false);
        selectedVariant.find('input[type="text"]').val('');
        selectedVariant.removeClass('field-variant-hidden');
    }

    // Проверка обязательных полей формы перед сабмитом
    regForm.submit(function() {
        var valid = true;
        var requiredInputs = regForm.find('.input.required');

        requiredInputs.removeClass('error');
        requiredInputs.each(function(k, v) {
            if (!$(v).prop('disabled') && $(v).val() == '') {
                $(v).addClass('error');
                valid = false;
            }
        });

        return valid;
    });
});




