function drawCabinetPieChart(canvasObject, labels, data) {
    // Генерация цветов
    var colors = {1: '#C65A5A', 2: '#0284D2', 3: '#3D62B2', 4: '#4C9464'};
    var bgColors = [];
    var borderColors = [];
    for (var i = 1; i <= labels.length; i++) {
        var repeatColor = colors[i % Object.keys(colors).length + 1];
        bgColors.push(repeatColor);
        borderColors.push(repeatColor);
    }

    var ctx = canvasObject.getContext('2d');
    ctx.height = 300;
    var myChart = new Chart(ctx, {
        type: 'doughnut',
        data: {
            labels: labels,
            datasets: [{
                data: data,
                backgroundColor: bgColors,
                borderColor: borderColors,
                borderWidth: 1
            }]
        },
        options: {
            responsive: true,
            maintainAspectRatio: false,
            legend: {
                position: 'right',
                labels: {
                    generateLabels: function(chart) {
                        var data = chart.data;
                        if (data.labels.length && data.datasets.length) {
                            return data.labels.map(function(label, i) {
                                var meta = chart.getDatasetMeta(0);
                                var ds = data.datasets[0];
                                var arc = meta.data[i];
                                var custom = arc && arc.custom || {};
                                var getValueAtIndexOrDefault = Chart.helpers.getValueAtIndexOrDefault;
                                var arcOpts = chart.options.elements.arc;
                                var fill = custom.backgroundColor ? custom.backgroundColor : getValueAtIndexOrDefault(ds.backgroundColor, i, arcOpts.backgroundColor);
                                var stroke = custom.borderColor ? custom.borderColor : getValueAtIndexOrDefault(ds.borderColor, i, arcOpts.borderColor);
                                var bw = custom.borderWidth ? custom.borderWidth : getValueAtIndexOrDefault(ds.borderWidth, i, arcOpts.borderWidth);

                                // We get the value of the current label
                                var value = chart.config.data.datasets[arc._datasetIndex].data[arc._index];

                                return {
                                    // Instead of `text: label,`
                                    // We add the value to the string
                                    text: label + ': ' + value,
                                    fillStyle: fill,
                                    strokeStyle: stroke,
                                    lineWidth: bw,
                                    hidden: isNaN(ds.data[i]) || meta.data[i].hidden,
                                    index: i
                                };
                            });
                        } else {
                            return [];
                        }
                    },
                    usePointStyle: true,
                    fontSize: 14,
                    fontColor: '#000',
                    padding: 15,
                    fontFamily: "'HelveticaNeue', 'Arial', sans-serif"
                }
            },
            cutoutPercentage: 45
        }
    });
}


