function initTagChooser(tagChooser) {
    var tagChooserWrapper = tagChooser.closest('.new-form__tags-input');
    var tagsWrapper = tagChooserWrapper.siblings('.new-form__tags');

    tagChooser.select2({
        containerCssClass: 'select--form select--light',
        placeholder: 'Начните вводить или выберите из списка',
        width: '100%',
        dropdownAutoWidth: true,
        dropdownCssClass: 'select__dropdown--common select__search--new',
        dropdownParent: tagChooser.closest('.select'),
        tags: true
    });

    tagChooser.on('select2:select', function(e) {
        var selectedOption = $(this).find('option:selected');
        var newOption = selectedOption.data('select2Tag') === true;

        // Создаем новое ключевое слово
        if (newOption) {
            $.post('/ajax/ajax-cabinet-org/add-tag', {text: selectedOption.text()}, function(res) {
                if (res.success) {
                    selectedOption.removeAttr('data-select2-tag');
                    selectedOption.val(res.id);
                }
            }, 'json');
        }
    });

    tagChooserWrapper.find('.tag-add-btn').click(function(e) {
        e.preventDefault();

        var tagProto = tagsWrapper.find('.tag--proto');

        if (tagChooser.val() != '') {
            // Проверка на уже добавленный тэг
            if (tagsWrapper.find('input[value="' + tagChooser.val() + '"]').length) {
                return false;
            }

            var newTag = tagProto.clone(true).removeClass('tag--proto').appendTo(tagsWrapper);
            newTag.find('.text').text(tagChooser.find('option:selected').text());
            newTag.find('input').val(tagChooser.val());
        }
    });
}





